import LoginPage from './Screens/loginPage';
import LandingPage from './Screens/landingPage';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
        <Route path='/' exact={true}>
          <LandingPage/>
        </Route>
        <Route path='/register'>
          <LoginPage/>
        </Route>
    </Router>
  );
}

export default App;
